def secondary_decrypt(ciphertext, key):
    iv = b'0123456789abcdef'
    from Crypto.Cipher import AES
    from Crypto.Util.Padding import unpad
    import base64
    cipher = AES.new(key.encode('utf-8'), AES.MODE_CBC, iv)
    decrypted_padded = cipher.decrypt(base64.b64decode(ciphertext))
    return unpad(decrypted_padded, AES.block_size).decode('utf-8')
def tertiary_decrypt(ciphertext, key):
    iv = b'abcdef0123456789'
    from Crypto.Cipher import AES
    from Crypto.Util.Padding import unpad
    import base64
    cipher = AES.new(key.encode('utf-8'), AES.MODE_CBC, iv)
    decrypted_padded = cipher.decrypt(base64.b64decode(ciphertext))
    return unpad(decrypted_padded, AES.block_size).decode('utf-8')
def hard_xor_decrypt(b64_str, key_str):
    from Crypto.Protocol.KDF import PBKDF2
    import base64
    encrypted = base64.b64decode(b64_str)
    keystream = PBKDF2(key_str, b'hard_xor_salt', dkLen=len(encrypted), count=1000000)
    decrypted = bytes([e ^ k for e, k in zip(encrypted, keystream)])
    return decrypted.decode('utf-8')
def _decrypt_obf(s, key):
    import base64
    data = base64.b64decode(s)
    return ''.join(chr(b ^ key) for b in data)
